import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';
import {  Link } from 'react-router-dom';

const SignedInLinks = () => {
    return (
        <Nav className="ml-auto" navbar>
            <NavItem><NavLink  to='/'>Felhasználók</NavLink></NavItem>
            <NavItem><NavLink tag={Link} to='/'>Statisztika</NavLink></NavItem>
            <NavItem><NavLink tag={Link} to='/'>Jegytípusok</NavLink></NavItem>
            <NavItem>
                <NavLink href="/components/">Főoldal</NavLink>
              </NavItem>
        </Nav>
    )
}

export default SignedInLinks;
